import React from "react";
import {
  Typography,
  Box,
  Button,
  Avatar,
  Input,
  Checkbox,
  Link,
  Divider,
} from "@material-ui/core";

const signUp = () => {
  return (
    <div style={{ backgroundColor: "#3598DC", paddingBottom: "40px" }}>
      <div
        style={{
          display: "flex",
          flexDirection: "row",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <Box
          style={{
            borderRadius: "2px",
            width: "380px",
            height: "500px",
            backgroundColor: "#F7F7F7",
            padding: "20px",
            margin: "30px",
          }}
          boxShadow={1}
        >
          <Typography
            style={{
              color: "333333",
              textAlign: "left",
              fontSize: "30px ",
              fontWeight: "bold",
            }}
          >
            Sign Up{" "}
          </Typography>
          <Typography style={{ color: "#9C9C9C", padding: "5px" }}>
            Please fill in this form to create an account!
          </Typography>
          <Divider style={{ width: "100%" }} />
        </Box>

        <Box style={{display:"flex", }}>


        </Box>
      </div>
    </div>
  );
};

export default signUp;
